import { Route, Routes } from "react-router-dom";
import "./App.css";
import Home from "./pages/Home"

function App() {
  return (
    <div className="w-screen min-h-screen bg-richblue-900 flex flex-col font-inter">
      <Routes>
            <Route path="/" element={<Home/>}></Route>
      </Routes>
    </div>
  );
}

export default App;
